INSERT INTO `comments` (`id`, `parent_id`, `subject`, `text`, `author`, `email`, `phone`, `active`, `ip`, `datetime`, `grade`, `siteuser_id`, `user_id`, `deleted`) VALUES
(43, 0, '', 'Пух, что&nbsp;ты&nbsp;думаешь по&nbsp;этому поводу?', '', '', NULL, 1, '127.0.0.1', '2008-03-22 18:53:31', 4, 3, 19, 0),
(44, 1, '', 'Если я&nbsp;чешу в&nbsp;затылке -<br />\r\nНе&nbsp;беда!<br />\r\nВ&nbsp;голове моей опилки,<br />\r\nДа, да, да.<br />\r\nно&nbsp;хотя там&nbsp;и&nbsp;оплики,<br />\r\nНо&nbsp;кричалки и&nbsp;вопилки,<br />\r\nНо&nbsp;кричалки и&nbsp;вопилки,<br />\r\nА&nbsp;также:<br />\r\nШумелки, пыхтелки и&nbsp;сопелки,-<br />\r\nСочинию я&nbsp;неплохо иногда.<br />\r\nДа!', '', '', NULL, 1, '127.0.0.1', '2008-03-22 18:56:11', 0, 1, 19, 0),
(45, 2, '', 'Да, кричалки и&nbsp;вопилки ты&nbsp;неплохо сочиняешь.', '', '', NULL, 1, '127.0.0.1', '2008-03-23 10:20:17', 0, 3, 19, 0),
(46, 0, '', 'Замечательный макет с&nbsp;солнечным цветком!', '', '', NULL, 1, '192.168.0.1', '2008-04-24 10:54:42', 5, 3, 19, 0),
(47, 0, '', 'Холодно.', '', '', NULL, 1, '192.168.0.1', '2008-04-24 17:36:10', 4, 3, 19, 0);
