INSERT INTO `constants` (`id`, `constant_dir_id`, `name`, `value`, `description`, `active`, `user_id`, `deleted`) VALUES
(1, 0, 'ALLOW_PANEL', 'false', 'Константа, определяющая показывать на сайте панель управления в случае авторизации пользователя в административной части или нет ', 0, 19, 0),
(2, 0, 'CURRENT_VERSION', '6.7.2', 'Текущая версия системы', 1, 19, 0),
(3, 0, 'HOSTCMS_UPDATE_SERVER', 'www.hostcms.ru', '', 1, 19, 0),
(4, 0, 'HOSTCMS_UPDATE_NUMBER', '162', '', 1, 19, 0),
(5, 0, 'USE_WYSIWYG', 'true', 'Разрешает использование визуального редактора', 1, 19, 0),
(6, 0, 'JPG_QUALITY', '60', 'Качество JPG изображений при преобразовании (0 - наихудшее, 100 - наилучшее). Рекомендовано 75.', 1, 19, 0),
(7, 0, 'PNG_QUALITY', '9', 'Качество PNG изображений при преобразовании (0 - наилучшее, 9 - наихудшее). Рекомендовано 6.', 1, 0, 0),
(9, 0, 'ALLOW_SHOW_XML', 'true', 'Разрешает отображение сгенерированного XML кода при поступлении методом GET запроса ''show_xml''  по умолчанию - выключено', 1, 19, 0),
(10, 0, 'USER_NONE', '#####', 'Имя пользователя в log-ах, если пользователь не определен (например, ошибка в клиентском разделе).', 1, 19, 0),
(11, 0, 'ON_PAGE', '20', 'Количество записей, выводимых на страницу в центре администрирования по умолчанию.', 1, 19, 0),
(12, 0, 'DEFAULT_LNG', 'ru', 'Константа, определяющая язык раздела администрирования по умолчанию', 1, 19, 0),
(13, 0, 'SUPERUSER_EMAIL', 'admin@localhost.ru', 'Адрес эл. почты главного администратора системы управления', 1, 19, 0),
(14, 0, 'MAIL_EVENTS_STATUS', '2', 'Константа, определяет, какие события будут отправляться администратору по почте.\r\nНапример, при значении 2 будут отправляться сообщения о событиях со статусом 2 и выше\r\nСтатусы событий:\r\n0 - Нейтральные события;\r\n1 - Успешные события;\r\n2 - События низкого уровня критичности;\r\n3 - События среднего уровня критичности;\r\n4 - События наивысшего уровня критичности.', 1, 19, 0),
(15, 0, 'STAT_PERIOD_STORAGE', '30', 'Время хранения подробной статистики в днях', 1, 19, 0),
(16, 0, 'ADD_COMMENT_DELAY', '10', 'Время (в секундах) в течение которого пользователь не может добавлять комментарии', 1, 19, 0),
(17, 0, 'EXTENSION_NOT_IN_BACKUP', 'zip rar xls', 'Расширения файлов, не включаемые в архив резервной копии, указываются в одну строчку через пробел', 1, 19, 0),
(18, 0, 'ALLOW_SET_LOCALE', 'true', 'Разрешает установку локали, по умолчанию true', 1, 19, 0),
(19, 0, 'LOG_DAYS_LIMIT', '30', 'Константа, определяющая количество дней, за которые хранятся log-файлы', 1, 19, 0),
(20, 0, 'COUNTER_NUM_MAIL_TABLE_ROW', '20', 'Количество строк в таблицах ежедневного письма-отчета о посещаемости сайта.', 1, 19, 0),
(21, 0, 'EXPIRES_TIME', '0', 'Время в секундах, на которое увеличивается текущее время, указываемое в заголовке Expires.', 1, 19, 0),
(22, 0, 'LAST_MODIFIED_TIME', '0', 'Время в секундах, на которое увеличивается текущее время, указываемое в заголовке Last-Modified.', 1, 19, 0),
(23, 0, 'ALLOW_SHOW_SQL', 'false', 'Разрешает показ SQL-запросов в верхней панели клиентского раздела сайта.', 1, 19, 0),
(24, 0, 'USE_ONLY_HTTPS_AUTHORIZATION', 'true', 'Устанавливает возможность авторизации в центре администрирования только по защищенному протоколу HTTPS.', 0, 19, 0),
(25, 0, 'DENY_LOCATION_302_LAST_SLASH', 'true', 'Запрещает 302-й редирект к последнему слэшу. При отсутствии константы редирект происходит. Для запрета редиректа установите значение true.', 0, 19, 0),
(26, 0, 'NOT_EXISTS_FILE_404_ERROR', 'false', 'Разрешает выдачу заголовка 404 при попытке запросить отсутствующий файл, например: /myfile.htm. Используется для ускорения обработки подобных запросов. Для запрета выдачи заголовка 404 установите значение false.', 0, 19, 0),
(27, 0, 'OPTIONAL_LAST_SLASH', 'true', 'озволяет не указывать последний слэш в пути к разделу. По умолчанию имеет значение false.\r\nПри значении true эквивалентным является указание http://www.site.ru/news и http://www.site.ru/news/\r\nПри значении false верным является указание http://www.site.ru/news/', 0, 19, 0),
(28, 0, 'SEO_YANDEX_LR', '213', 'Указания региона, для которого осуществляется определение позиций в SEO-модуле. Если константа не задана, определение ведется для региона Москва (код 213). Полный список регионов можно найти на странице http://search.yaca.yandex.ru/geo.c2n', 1, 19, 0),
(29, 0, 'YANDEX_XML_USER', '', 'Пользователя для использования Яндекс.XML', 0, 19, 0),
(30, 0, 'YANDEX_XML_KEY', '', 'Ключ для использования Яндекс.XML', 0, 19, 0),
(31, 0, 'EXPORT_CSV_ENCODING', 'windows-1251', '', 1, 19, 0),
(32, 0, 'SYNTAX_HIGHLIGHTING', 'true', 'Подсветка синтаксиса редактора кода, по умолчанию true', 1, 19, 0),
(33, 0, 'SHOP_DEFAULT_CML_CURRENCY_NAME', 'Розничная', '', 1, 19, 0),
(34, 0, 'START_BENCHMARK', '0', 'Включить мониторинг быстродействия сайта', 1, 19, 0),
(35, 0, 'SHOP_ORDER_CARD_XSL', 'МагазинКарточкаЗаказа', '', 0, 19, 0),
(36, 0, 'YANDEX_TRANSLATE_KEY', '', 'Ключ для Яндекс.Translate, используется для перевода элементов пути. См. https://tech.yandex.ru/keys/?service=trnsl', 1, 19, 0);
INSERT INTO `documents` (`id`, `document_dir_id`, `document_status_id`, `template_id`, `name`, `text`, `datetime`, `user_id`, `site_id`, `deleted`) VALUES
(2, 0, 0, 7, 'Главная страница', '<h1>Добро пожаловать на демонстрационный сайт HostCMS</h1>\r\n<p><b>HostCMS v. 6 — удобная современная система управления сайтами. Управление сайтом, корректировка новостей, пресс-релизов производится с использование интуитивно-понятного интерфейса.</b></p>\r\n<p>Управлять сайтом очень просто — перейдите в <a href="/admin/" target="_self">центр администрирования</a> и авторизируйтесь с использованием следующих данных:<br/>\r\nПользователь: <b>admin</b>, Пароль: <b>admin</b></p>\r\n<p class="button"><a href="/admin/" title="Авторизоваться">Авторизоваться</a></p>', '2008-04-22 10:30:44', 19, 1, 0),
(4, 1, 0, 9, 'Ошибка 403', '<h1>Ошибка 403</h1>\r\n<p>Доступ запрещен. Авторизируйтесь&nbsp;или перейдите на&nbsp;<a href="/" target="_self">главную страницу</a>.</p>', '2008-03-14 15:05:33', 19, 1, 0),
(5, 1, 0, 9, 'Ошибка 404', '<h1>Ошибка 404</h1>\r\n<p>Запрашиваемый документ не&nbsp;найден!</p>\r\n<p>Перейдите на&nbsp;<a href="/" target="_self">главную страницу</a>.</p>', '2008-03-14 15:05:14', 19, 1, 0),
(6, 1, 0, 9, 'Сайт отключен', '<h1>Сайт временно недоступен!</h1>\r\n<p>Попробуйте обратиться позднее.</p>', '2008-04-24 14:14:50', 19, 1, 0),
(7, 2, 0, 1, 'Краткие контактные данные', '<h2 style="margin-top: 0;"><a href="/contacts/" title="Контактные данные">Контактные данные</a></h2>\r\n				<dl>\r\n					<dt>Телефон:</dt>\r\n					<dd class="phone d_gray">+7(495) <span>321-456-7</span></dd>\r\n					<dt>Электронная почта:</dt>\r\n					<dd><a href="mailto:info@mysite.ru" >info@mysite.ru</a></dd>\r\n					<dt>Адрес:</dt>\r\n					<dd class="d_gray">ул. Пушкина, д. 123, оф. 456 г. Москва, 101000</dd>\r\n				</dl>', '2009-11-22 17:03:04', 19, 1, 0),
(8, 2, 1, 9, 'Контактные данные', '<h1>Контактные данные</h2>\r\n<dl>\r\n	<dt>Телефон:</dt> <dd class="phone d_gray">+7 (495) <span>321-456-7</span></dd> <dt>Электронная почта:</dt> <dd><a href="mailto:info@mysite.ru">info@mysite.ru</a></dd> <dt>Адрес:</dt> <dd class="d_gray">101000, г. Москва, ул. Пушкина, д. 123</dd> </dl>', '2009-11-22 17:08:58', 19, 1, 0);
