(1, 1, 0, 0, '2008-03-14 11:28:12', '2008-03-14 11:28:12', '0000-00-00 00:00:00', 'Best Buy станет конкурентом iTunes', '<p>Компания Best Buy, владеющая крупной сетью магазинов по&nbsp;продаже электроники, при&nbsp;сотрудничестве с&nbsp;SanDisk и&nbsp;RealNetworks станет новым пунктом в&nbsp;списке конкурентов музыкального сервиса iTunes. Сервис Best Buy&nbsp;Digital Music Store будет находится под&nbsp;управлением Rhapsody 4.0 и&nbsp;предложит все&nbsp;основные функции схожих сервисов, включая подписку на&nbsp;неограниченное прослушивание музыкальных композиций в&nbsp;течение месяца.</p>', 1, '<p>Компания Best Buy, владеющая крупной сетью магазинов по&nbsp;продаже электроники, при&nbsp;сотрудничестве с&nbsp;SanDisk и&nbsp;RealNetworks станет новым пунктом в&nbsp;списке конкурентов музыкального сервиса iTunes. Сервис Best Buy&nbsp;Digital Music Store будет находится под&nbsp;управлением Rhapsody 4.0 и&nbsp;предложит все&nbsp;основные функции схожих сервисов, включая подписку на&nbsp;неограниченное прослушивание музыкальных композиций в&nbsp;течение месяца.</p>\r\n<p>Специально для&nbsp;работы с&nbsp;сервисом оптимизированы mp3-плееры SanDisk Sana e200R Rhapsody. Как&nbsp;сообщает TECHlabs, cам&nbsp;сервис одновременно с&nbsp;плеерами появится 15&nbsp;октября. Дженнифер Шэйдлер<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">(Jennifer</span> Schaidler), вице-президент нового музыкального отделения Best Buy, отметил, что&nbsp;отличие от&nbsp;Rhapsody будет заключаться в&nbsp;эксклюзивных произведениях, которые будут доступны только пользователям Best Buy&nbsp;Digital Music Store. Заявленная цена одной песни составляет $0.99&nbsp;или $14.99 за&nbsp;неограниченный доступ.</p>', '', '', 216, 300, 50, 70, 0, '192.168.0.7', '1', 1, '', '', '', -1, 22, 19, 0, '', 0),
(2, 1, 0, 0, '2008-03-14 11:30:05', '2008-03-14 11:30:05', '0000-00-00 00:00:00', 'Совет безопасности ООН требует от КНДР отказаться от ядерного оружия', '<p>Совет Безопасности ООН&nbsp;принял декларацию, в&nbsp;которой содержится\r\nтребование к&nbsp;КНДР отказаться от&nbsp;ядерных испытаний и&nbsp;вернуться за&nbsp;стол\r\nшестисторонних переговоров по&nbsp;урегулированию ядерного кризиса\r\nна&nbsp;Корейском полуострове. С&nbsp;таким заявлением выступил в&nbsp;пятницу\r\nпостоянный представитель России в&nbsp;ООН&nbsp;Виталий Чуркин.</p>', 1, '<p>Совет Безопасности ООН&nbsp;принял декларацию, в&nbsp;которой содержится\r\nтребование к&nbsp;КНДР отказаться от&nbsp;ядерных испытаний и&nbsp;вернуться за&nbsp;стол\r\nшестисторонних переговоров по&nbsp;урегулированию ядерного кризиса\r\nна&nbsp;Корейском полуострове. С&nbsp;таким заявлением выступил в&nbsp;пятницу\r\nпостоянный\r\nпредставитель России в&nbsp;ООН&nbsp;Виталий Чуркин. В&nbsp;тексте декларации\r\nне&nbsp;содержится угроз санкций, а&nbsp;лишь отмечается, что<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">&laquo;</span>если КНДР\r\nне&nbsp;прислушается к&nbsp;призывам международного сообщества, Совет\r\nБезопасности\r\nбудет действовать со&nbsp;всей ответственностью в&nbsp;рамках Устава ООН&raquo;,\r\nпередает слова Чуркина<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">&laquo;</span>Интерфакс&raquo;. Дипломат также подчеркнул,\r\nчто&nbsp;возможные ядерные испытания<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">&laquo;</span>представляют явную угрозу миру\r\nи&nbsp;международной стабильности&raquo;. По&nbsp;словам российского дипломата,<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">&laquo;</span>это -\r\nочень хорошая декларация&raquo;, и&nbsp;он<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">&laquo;</span>рад тому, что&nbsp;она&nbsp;была принята&raquo;.\r\nВ&nbsp;начале этой недели Пхеньян объявил о&nbsp;намерении испытать ядерное\r\nоружие\r\nдля&nbsp;укрепления сил&nbsp;сдерживания на&nbsp;фоне враждебной политики со&nbsp;стороны\r\nСША. Озабоченность планами КНДР высказали все&nbsp;ее&nbsp;соседи, включая Китай\r\nи&nbsp;Россию. По&nbsp;последним сообщениям из&nbsp;США, Белый дом, отслеживающий\r\nядерную активность КНДР, не&nbsp;располагает свежими подтверждениями о&nbsp;том,\r\nчто&nbsp;испытание может быть осуществлено в&nbsp;ближайшие выходные. Об&nbsp;этом\r\nсообщила официальный представитель администрации Дана Перино.<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">&laquo;</span>Наша\r\nпозиция совершенно ясна,&nbsp;&mdash; сказала заместитель пресс-секретаря.&nbsp;&mdash;\r\nМы&nbsp;считаем, что&nbsp;Северная Корея не&nbsp;должна проводить испытаний ядерного\r\nоружия. Мы&nbsp;доводили это&nbsp;до&nbsp;ее&nbsp;сведения как&nbsp;в&nbsp;публичных заявлениях,\r\nтак&nbsp;и&nbsp;конфиденциально&raquo;. По&nbsp;словам Перино, США&nbsp;намерены<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">&laquo;</span>продолжать\r\nработать\r\nс&nbsp;партнерами по&nbsp;шестисторонним переговорам, чтобы, используя свое\r\nи&nbsp;их&nbsp;влияние, подчеркнуть, насколько важно предотвратить\r\nэто&nbsp;испытание&raquo;.\r\nИзвестие о&nbsp;том, будто США&nbsp;и&nbsp;Япония полагают, что&nbsp;КНДР уже&nbsp;в&nbsp;ближайшие\r\nсубботу-воскресенье может провести ядерное испытание, поступило ранее\r\nсегодня со&nbsp;ссылкой на&nbsp;первого заместителя главы японского МИД&nbsp;Сиотаро\r\nЯти, находящегося с&nbsp;визитом в&nbsp;Вашингтоне.</p>', '', '', 199, 300, 46, 70, 0, '192.168.0.7', '2', 1, '', '', '', -1, 0, 19, 0, '', 0),
(3, 1, 0, 0, '2008-03-14 11:31:05', '2008-03-14 11:31:05', '0000-00-00 00:00:00', 'Директор Эрмитажа выступает против передела музейных фондов', '<p>Пушкина Ирины Антоновой о&nbsp;том, что&nbsp;было бы&nbsp;справедливо вернуть из&nbsp;Эрмитажа в&nbsp;Москву часть коллекции французских импрессионистов.\r\nМ.Пиотровский отметил, что&nbsp;около 200&nbsp;шедевров в&nbsp;коллекции Пушкинского музея происходят из&nbsp;Эрмитажа.</p>', 1, '<p>Пушкина Ирины Антоновой о&nbsp;том, что&nbsp;было бы&nbsp;справедливо вернуть из&nbsp;Эрмитажа в&nbsp;Москву часть коллекции французских импрессионистов.<br /> М.Пиотровский отметил, что&nbsp;около 200&nbsp;шедевров в&nbsp;коллекции Пушкинского музея происходят из&nbsp;Эрмитажа.</p>', '', '', 0, 0, 0, 0, 0, '192.168.0.7', '3', 1, '', '', '', -1, 0, 19, 0, '', 0),
(4, 1, 0, 0, '2008-03-14 11:31:49', '2008-03-14 11:31:49', '0000-00-00 00:00:00', 'Наступающий год в Австрии будет Годом Моцарта', '<p>В наступающем году в&nbsp;Австрии не&nbsp;будет и&nbsp;дня, который не&nbsp;был&nbsp;бы&nbsp;посвящен\r\nкакому-либо мероприятию памяти великого австрийского композитора,\r\nсо&nbsp;дня&nbsp;рождения которого исполняется 250&nbsp;&hellip;</p>', 1, '<p>В&nbsp;наступающем году в&nbsp;Австрии не&nbsp;будет и&nbsp;дня, который не&nbsp;был&nbsp;бы&nbsp;посвящен\r\nкакому-либо мероприятию памяти великого австрийского композитора,\r\nсо&nbsp;дня&nbsp;рождения которого исполняется 250&nbsp;&hellip; <br /> Основные фестивали и&nbsp;концерты, выставки и&nbsp;представления пройдут в&nbsp;Вене и&nbsp;Зальцбурге&nbsp;&mdash; родном городе композитора.</p>', '', '', 0, 0, 0, 0, 0, '192.168.0.7', '4', 1, '', '', '', -1, 0, 19, 1, '', 0),
(5, 7, 1, 0, '2008-03-14 11:35:32', '2008-03-14 11:35:32', '0000-00-00 00:00:00', 'ООО "Хостмэйк" - Web-дизайн студия', '', 1, '<p>Интернет Агентство<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">&laquo;ХостМэйк</span>&raquo; основано в&nbsp;апреле 2002 года и&nbsp;предлагает\r\nуслуги наивысшего качества по&nbsp;конкурентным ценам предприятиям и&nbsp;организациям Москвы, Ростова-на-Дону и&nbsp;области, а&nbsp;также организациям\r\nдругих регионов России.<br /> ХостМэйк имеет обширный и&nbsp;плодотворный опыт реализации проектов с&nbsp;территориально удаленными заказчиками. Вы&nbsp;можете заказать у&nbsp;нас&nbsp;создание сайта, находясь в&nbsp;любом городе&nbsp;или стране. На&nbsp;результативности\r\nнашего с&nbsp;Вами сотрудничества расстояния не&nbsp;сказываются.</p>', '', '', 0, 0, 0, 0, 0, '192.168.0.7', 'hostmake.ru', 1, '', '', '', -1, 0, 19, 0, '', 0),
(6, 1, 2, 0, '2008-03-14 11:42:52', '2008-03-14 11:42:52', '0000-00-00 00:00:00', 'В российский прокат вышли фильмы "Гарри Поттер и Кубок огня" и "Хроники Нарнии"', '<p>В четверг в&nbsp;российский прокат вышли сразу два&nbsp;фильма, обещающие\r\nзначительные кассовые сборы:<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">&laquo;Хроники</span> Нарнии: Лев, колдунья и&nbsp;волшебный\r\nшкаф&raquo; Эндрю Адамсона и<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">&laquo;Гарри</span> Поттер и&nbsp;Кубок огня&raquo; Майка Ньюэлла.</p>', 1, '<p>В&nbsp;четверг в&nbsp;российский прокат вышли сразу два&nbsp;фильма, обещающие\r\nзначительные кассовые сборы:<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">&laquo;Хроники</span> Нарнии: Лев, колдунья и&nbsp;волшебный\r\nшкаф&raquo; Эндрю Адамсона и<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">&laquo;Гарри</span> Поттер и&nbsp;Кубок огня&raquo; Майка Ньюэлла.</p>\r\n<p>Четвертый фильм<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">&laquo;поттерианы</span>&raquo; поставил рекорд уже&nbsp;в&nbsp;первый уикенд после\r\nвыхода картины в&nbsp;широкий прокат в&nbsp;США&nbsp;и&nbsp;других странах.<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">&laquo;Гарри</span> Поттер\r\nи&nbsp;Кубок огня&raquo; выручил во&nbsp;всем мире 181,4 миллиона долларов, включая\r\n101,4 миллиона в&nbsp;США. Таким образом были побиты рекорды предыдущих трех\r\nфильмов о&nbsp;приключениях юного волшебника.</p>', '', '', 0, 0, 0, 0, 0, '192.168.0.7', '6', 1, '', '', '', -1, 1, 19, 0, '', 0),
(7, 1, 2, 0, '2008-03-14 11:43:49', '2008-03-14 11:43:49', '0000-00-00 00:00:00', '"Инопланетянин" Стивена Спилберга назван лучшим семейным фильмом', '<p>Фильм 1982 года<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">&laquo;Инопланетянин</span>&raquo; Стивена Спилберга оказался на&nbsp;первом\r\nместе в&nbsp;рейтинге 100&nbsp;самых лучших семейных картин. Опрос проводил среди\r\nсвоих зрителей британский канал Channel 4.</p>', 1, '<p>Фильм 1982 года<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">&laquo;Инопланетянин</span>&raquo; Стивена Спилберга оказался на&nbsp;первом\r\nместе в&nbsp;рейтинге 100&nbsp;самых лучших семейных картин. Опрос проводил среди\r\nсвоих зрителей британский канал Channel 4.</p>\r\n<p>Еще&nbsp;две&nbsp;картины Спилберга также оказались в&nbsp;списке&nbsp;&mdash;<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">&laquo;Парк</span> Юрского\r\nпериода&raquo; занял 12-е место,<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">&laquo;В</span> поисках утраченного ковчега&raquo; зрители\r\nпоместили на&nbsp;20-е место.</p>', '', '', 0, 0, 0, 0, 0, '192.168.0.7', '7', 1, '', '', '', -1, 3, 19, 0, '', 0),
(8, 13, 0, 0, '2008-03-14 11:45:44', '2008-03-14 11:45:44', '0000-00-00 00:00:00', 'Слонопротирщик (от 3 000 до 5 000 руб.)', '<p>Работодатель: Частный зоопарк, Москва:</p>\r\n<p>Требования: Полный рабочий день</p>', 1, '<p>Работодатель: Частный зоопарк, Москва:</p>\r\n<p>Требования: Полный рабочий день</p>\r\n<p>СРОЧНО!!! В&nbsp;зоопарк в&nbsp;связи с&nbsp;выходом на&nbsp;пенсию основной части работников, требуется на&nbsp;увлекательную и&nbsp;перспктивную должность на&nbsp;полставки слонопротирщик задней части.</p>\r\n<p>Обязательные условия:</p>\r\n<p>1. Отсутствие брезгливости и&nbsp;аллергии на&nbsp;животных.<br /> 2. Чистоплотность.<br /> 3. Длинные руки.<br /> 4. Непредвзятое отношение к&nbsp;слонам<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">(индийские</span>, африканские)<br /> 5. Знать анатомию слона и&nbsp;понимать их&nbsp;язык<br /> 6. Приятная внешность.</p>\r\n<p>&mdash; Работа на&nbsp;свежем воздухе.<br />&nbsp;&mdash; Социальный пакет.<br />&nbsp;&mdash; Компенсация расходов на&nbsp;мыло и&nbsp;шампунь.<br />&nbsp;&mdash; Душ&nbsp;на&nbsp;территории зоопарка.</p>', '', '', 0, 0, 0, 0, 0, '192.168.0.7', '8', 1, '', '', '', -1, 6, 19, 0, '', 0),
(9, 5, 0, 0, '2008-03-14 12:11:32', '2008-03-14 12:11:32', '0000-00-00 00:00:00', 'Canon украсил фотоаппараты бриллиантами', '<p>Европейское подразделение японской компании Canon начала выпуск весьма\r\nоригинальных цифровых фотоаппаратов Diamond IXUS. Уже&nbsp;из&nbsp;одного\r\nназвания понятно, что&nbsp;потребителей собираются поразить необычными\r\nдизайнерскими находками, что&nbsp;в&nbsp;общем вполне закономерно, учитывая\r\nнаправленность серии IXUS, которой недавно исполнилось 10&nbsp;лет.</p>', 1, '<p>Европейское подразделение японской компании Canon начала выпуск весьма\r\nоригинальных цифровых фотоаппаратов Diamond IXUS. Уже&nbsp;из&nbsp;одного\r\nназвания понятно, что&nbsp;потребителей собираются поразить необычными\r\nдизайнерскими находками, что&nbsp;в&nbsp;общем вполне закономерно, учитывая\r\nнаправленность серии IXUS, которой недавно исполнилось 10&nbsp;лет.</p>\r\n<p>Как&nbsp;утверждают производители, новые фотоаппараты в&nbsp;этой серии\r\nукрашаются бриллиантами, сообщает 3DNews. Всего в&nbsp;серии выпустили\r\n10&nbsp;аппаратов на&nbsp;основе модели Digital IXUS 65. 9&nbsp;из них&nbsp;инкрустировано\r\n80&nbsp;белыми&nbsp;или 80&nbsp;черными бриллиантами от&nbsp;Эдди Элзаса, владельца одной\r\nиз&nbsp;крупнейших мировых коллекций цветных камней. Стоит такая новинка\r\nот&nbsp;3500 евро. Зато десятый аппарат Super Diamond IXUS покрыт сразу\r\n380&nbsp;бриллиантами и&nbsp;оценивается не&nbsp;меньше чем&nbsp;в&nbsp;40&nbsp;тысяч евро. Заметим,\r\nчто&nbsp;приобрести такие аппараты в&nbsp;обычных магазинах нельзя. Фотокамеры\r\nDiamond IXUS выставляются на&nbsp;интернет-аукционе E-Bay. Открытые торги\r\nпроходят с&nbsp;6&nbsp;по 16&nbsp;декабря 2006 года. Все&nbsp;вырученные от&nbsp;продажи пройдут\r\nна&nbsp;счёт организации<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">&laquo;Красный</span> Крест&raquo;.</p>', '', '', 0, 0, 0, 0, 0, '192.168.0.7', '9', 1, '', '', '', -1, 0, 19, 0, '', 0),
(10, 5, 0, 0, '2008-03-14 12:12:18', '2008-03-14 12:12:18', '0000-00-00 00:00:00', '"Яндекс" запустил систему контекстной рекламы', '<p>Системы платы за&nbsp;клики существуют в&nbsp;Глобальной сети уже&nbsp;не&nbsp;первый год,\r\nоднако&nbsp;успех контекстной рекламы на&nbsp;альтернативных сетевых площадках\r\nпришел с&nbsp;внедрением компанией Google &hellip;</p>', 1, '<p>Системы платы за&nbsp;клики существуют в&nbsp;Глобальной сети уже&nbsp;не&nbsp;первый год,\r\nоднако&nbsp;успех контекстной рекламы на&nbsp;альтернативных сетевых площадках\r\nпришел с&nbsp;внедрением компанией Google &hellip; <br /> Очевидно, что&nbsp;с&nbsp;запуском рекламной сети<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">&laquo;Яндексу</span>&raquo; удастся повысить свою\r\nдолю на&nbsp;рынке контекстной рекламы в&nbsp;Рунете<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">(сегодня</span> она&nbsp;составляет 55%)</p>', '', '', 0, 0, 0, 0, 0, '192.168.0.7', '10', 1, '', '', '', -1, 6, 19, 0, '', 0),
(12, 5, 3, 0, '2008-03-14 12:20:03', '2008-03-14 12:20:03', '0000-00-00 00:00:00', 'В Рунете появилась социальная сеть для профессионалов', '<p>В Рунете появилась социальная сеть<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">&laquo;Мой</span> круг&raquo;, предназначенная для&nbsp;налаживания деловых контактов и&nbsp;управления ими. Проект организован\r\nгруппой недавних выпускников Московского физико-технического института,\r\nМГУ&nbsp;и&nbsp;Российской экономической школы, пишет Компьюлента.</p>', 1, '<p>В Рунете появилась социальная сеть<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">&laquo;Мой</span> круг&raquo;, предназначенная для&nbsp;налаживания деловых контактов и&nbsp;управления ими. Проект организован\r\nгруппой недавних выпускников Московского физико-технического института,\r\nМГУ&nbsp;и&nbsp;Российской экономической школы, пишет Компьюлента.</p>', '', '', 0, 0, 0, 0, 0, '192.168.0.7', '12', 1, '', '', '', -1, 0, 19, 0, '', 0),
(13, 5, 4, 0, '2008-03-14 12:22:27', '2008-03-14 12:22:27', '0000-00-00 00:00:00', 'Приобретение Maxtor оздоровит рынок', '<p>Аналитики из&nbsp;iSuppli на&nbsp;страницах DigiTimes набросились на&nbsp;недавнюю\r\nновость о&nbsp;покупке компанией Seagate известного производителя\r\nвинчестеров Maxtor и&nbsp;теперь пытаются сделать выводы &hellip;</p>', 1, '<p>Аналитики из&nbsp;iSuppli на&nbsp;страницах DigiTimes набросились на&nbsp;недавнюю\r\nновость о&nbsp;покупке компанией Seagate известного производителя\r\nвинчестеров Maxtor и&nbsp;теперь пытаются сделать выводы &hellip; <br /> Несмотря на&nbsp;то, что&nbsp;Seagate владела 28% рынка жёстких дисков, а&nbsp;Maxtor\r\n&mdash; 13.8%, ожидать, что&nbsp;обновлённая корпорация резко поднимет свои\r\nпродажи и&nbsp;оторвётся от&nbsp;Western Digital</p>', '', '', 0, 0, 0, 0, 0, '192.168.0.7', '13', 1, '', '', '', -1, 0, 19, 0, '', 0),
