(18, 11, 0, 0, '2008-03-14 12:36:00', '2008-03-14 12:36:00', '0000-00-00 00:00:00', 'Демонстрационный сайт системы управления сайтом HostCMS', '<p>Демонстрационный макет <a href="http://www.hostcms.ru/" target="_blank">системы управления сайтом HostCMS</a> интегрирован&nbsp;в демонстрационный сайт&nbsp;и релизы системы, поставляемые клиентам.</p>', 1, '<p>Демонстрационный макет <a href="http://www.hostcms.ru/" target="_blank">системы управления сайтом HostCMS</a> интегрирован&nbsp;в демонстрационный сайт&nbsp;и релизы системы, поставляемые клиентам.</p>', 'information_items_1205487614.jpg', 'small_information_items_1205487614.jpg', 500, 443, 150, 132, 0, '192.168.0.7', 'demosite', 1, '', '', '', -1, 18, 19, 0, '', 0),
