(21, 12, 0, 0, '2008-03-14 13:25:50', '2008-03-14 13:25:50', '0000-00-00 00:00:00', 'Apache', '', 1, '<p>Apache HTTP-сервер<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">(по</span>-русски обычно произносят Апач)&nbsp;&mdash; это&nbsp;web-сервер, с&nbsp;открытым исходным кодом. С&nbsp;апреля 1996 это&nbsp;самый\r\nпопулярный HTTP-сервер в&nbsp;Internet: в&nbsp;мае&nbsp;1999 года он&nbsp;работал на&nbsp;57%\r\nweb-серверов, в&nbsp;августе 2004 на&nbsp;67%.</p>\r\n<p>Основными достоинствами Apache считаются надежность, относительная\r\nустойчивость к&nbsp;взлому и&nbsp;гибкость конфигурации. Он&nbsp;позволяет подключать\r\nвнешние модули для&nbsp;предоставления данных, использовать СУБД для&nbsp;аутентификации пользователей, модифицировать сообщения об&nbsp;ошибках и&nbsp;т.\r\nд.</p>\r\n<p>Недостатком наиболее часто называется отсутствие удобного стандартного интерфейса для&nbsp;администратора.</p>', '', '', 0, 0, 0, 0, 0, '192.168.0.7', 'apache', 1, '', '', '', -1, 1, 19, 0, '', 0),
(22, 12, 0, 0, '2008-03-14 13:28:09', '2008-03-14 13:28:09', '0000-00-00 00:00:00', 'Linux', '', 1, '<p>Linux &mdash; свободная UNIX-подобная операционная система. Она&nbsp;основана на&nbsp;системных программах, разработанных в&nbsp;рамках проекта GNU, и&nbsp;на&nbsp;ядре\r\nLinux.</p>\r\n<p>Обычно по&nbsp;историческим причинам эта&nbsp;система называется просто<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">&laquo;Linux</span>&raquo;. В&nbsp;отличие от&nbsp;большинства других операционных систем, GNU/Linux\r\nне&nbsp;имеет единой<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">&laquo;официальной</span>&raquo; комплектации. Вместо этого GNU/Linux\r\nпоставляется в&nbsp;большом количестве так&nbsp;называемых дистрибутивов, в&nbsp;которых программы GNU&nbsp;соединяются с&nbsp;ядром Linux и&nbsp;другими программами.</p>\r\n<p>&nbsp;По материалам Википедии.</p>', '', '', 0, 0, 0, 0, 0, '192.168.0.7', 'linux', 1, '', '', '', -1, 2, 19, 0, '', 0),
(23, 12, 0, 0, '2008-03-14 13:29:00', '2008-03-14 13:29:00', '0000-00-00 00:00:00', 'Windows', '', 1, '<p>Microsoft Windows&nbsp;&mdash; семейство операционных систем компании Microsoft.</p>\r\n<p style="font-weight: bold;">Семейство Windows 9x&nbsp;</p>\r\n<p>Семейство ОС, разработанных специально для&nbsp;процессоров с&nbsp;32-битной\r\nархитектурой, на&nbsp;рынке позиционировались, как&nbsp;32-разрядные ОС,\r\nоднако&nbsp;содержали некоторое количество 16-битного кода, а&nbsp;собственно\r\n32-х разрядное ядро было усовершенствованным ядром Windows 3.1/3.11,\r\nработающим в&nbsp;расширенном режиме.</p>\r\n<p style="font-weight: bold;">Семейство Windows NT&nbsp;</p>\r\n<p>Операционные системы этого семейства работали на&nbsp;процессорах\r\nс&nbsp;архитектурой IA32 и&nbsp;некоторых RISC-процессорах: Alpha, MIPS. Windows\r\nNT&nbsp;являются полностью 32-битными операционными системами, и, в&nbsp;отличие\r\nот&nbsp;версий 1.0&mdash;3.x и&nbsp;9x, не&nbsp;нуждаются в&nbsp;поддержке со&nbsp;стороны MS-DOS.</p>\r\n<p>По&nbsp;материалам Википедии.&nbsp;</p>', '', '', 0, 0, 0, 0, 0, '192.168.0.7', 'windows', 1, '', '', '', -1, 4, 19, 0, '', 0),
(24, 12, 0, 0, '2008-03-14 13:29:22', '2008-03-14 13:29:22', '0000-00-00 00:00:00', 'Unix', '', 1, '<p>UNIX&nbsp;или Unix<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">(читается</span> как&nbsp;Юникс) &mdash; это&nbsp;группа переносимых,\r\nмногозадачных и&nbsp;многопользовательских операционных систем<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">(ОС</span>). Первая\r\nсистема UNIX была разработана в&nbsp;конце 1960-х &mdash; начале 1970-х годов в&nbsp;подразделении Bell Labs компании AT&amp;T.</p>\r\n<p>По материалам Википедии.</p>', '', '', 0, 0, 0, 0, 0, '192.168.0.7', 'unix', 1, '', '', '', -1, 2, 19, 0, '', 0),
