(40, 1, 0, 0, '2008-03-14 14:42:37', '2008-03-14 14:42:37', '0000-00-00 00:00:00', 'Хижина дяди Тома продана за миллион долларов', '<p>Вместе с&nbsp;прославленной лачугой округ Монтгомери получил дом&nbsp;рабовладельца Айзека Райли и&nbsp;часть фермы, принадлежавшей ему&nbsp;в&nbsp;XVIII-XIX веках.</p>', 1, '<p>Вместе с&nbsp;прославленной лачугой округ Монтгомери получил дом&nbsp;рабовладельца Айзека Райли и&nbsp;часть фермы, принадлежавшей ему&nbsp;в&nbsp;XVIII-XIX веках.<br /> Роман стал одним из&nbsp;главных американских бестселлеров XIX&nbsp;века и&nbsp;спровоцировал всплеск антирабовладельческих настроений в&nbsp;северных\r\nштатах</p>', '', '', 0, 0, 0, 0, 0, '192.168.0.7', '40', 1, '', '', '', -1, 2, 19, 0, '', 0),
