(45, 1, 0, 0, '2008-03-14 16:56:30', '2008-03-14 16:56:30', '0000-00-00 00:00:00', 'NVIDIA готовит 55-нм версию G92 для схватки с AMD RV770?', '<p>В конце второго квартала AMD&nbsp;планирует выпустить новый графический чип&nbsp;RV770, призванный защитить интересы компании в&nbsp;сегменте\r\nпроизводительных продуктов для&nbsp;настольных и&nbsp;мобильных компьютеров. На&nbsp;вопрос о&nbsp;том, чем&nbsp;может парировать NVIDIA, попытался ответить\r\nсингапурский сайт VR-Zone.&nbsp;</p>', 1, '<p style="text-align: justify;">В конце второго квартала AMD&nbsp;планирует выпустить новый графический\r\nчип&nbsp;RV770, призванный защитить интересы компании в&nbsp;сегменте\r\nпроизводительных продуктов для&nbsp;настольных и&nbsp;мобильных компьютеров.\r\nНа&nbsp;вопрос о&nbsp;том, чем&nbsp;может парировать NVIDIA, попытался ответить\r\nсингапурский сайт VR-Zone. Предполагается, что&nbsp;в&nbsp;оппозицию преемнику\r\nRV670 калифорнийцы готовят обновлённую версию видеочипа G92<span class="sss"> </span><span style="margin-right: 0.3em"> </span> <span class="aaa"><span style="margin-left: -0.3em">(D8P</span></span>).\r\nПроверенное временем ядро будет переведено на&nbsp;55-нм технологический\r\nпроцесс, который позволит улучшить частотный потенциал\r\nи&nbsp;энергоэффективность будущих продуктов. Завершить подготовку новой\r\nверсии чипа под&nbsp;условным названием G92b планируется в&nbsp;начале лета,\r\nпримерно в&nbsp;одно время с&nbsp;RV770.\r\n<br /><br />По&nbsp;данным сингапурского ресурса, приоритетным для&nbsp;дебютного 55-нм ядра\r\nNVIDIA станет мобильный рынок, где&nbsp;особенно важным является\r\nэкономичность чипов и&nbsp;их&nbsp;размер. В&nbsp;следующем сезоне G92b поборется\r\nс&nbsp;мобильной версией RV770 за&nbsp;интерес к&nbsp;себе со&nbsp;стороны ведущих\r\nпроизводителей ноутбуков. Вместе с&nbsp;тем, источник считает весьма\r\nвероятным применение обновлённого чипа с&nbsp;возросшей частотой\r\nи&nbsp;быстродействием в&nbsp;сегменте настольных компьютеров.<!-- pagebreak -->Позже обозреватели VR-Zone со&nbsp;ссылкой на&nbsp;собственные информационные\r\nканалы уточнили, что&nbsp;более<span class="sss"> </span><span style="margin-right: 0.3em"> </span> <span class="aaa"><span style="margin-left: -0.3em">&laquo;тонкий</span></span>&raquo; техпроцесс станет единственным\r\nотличием новой ревизии чипа G92&nbsp;от&nbsp;используемой в&nbsp;видеокартах GeForce\r\n8800 GS/GT/GTS 512&nbsp;Мб. Каких-либо архитектурных изменений\r\nне&nbsp;предвидится. С&nbsp;переходом на&nbsp;55-нм технологию площадь ядра уменьшится\r\nна&nbsp;17%. Кроме того, ожидается заметное увеличение выхода годных чипов\r\nи,\r\nкак&nbsp;следствие, улучшение рентабельности производства.\r\n<br /><br />Так&nbsp;как&nbsp;речь зашла о&nbsp;новом техпроцессе, попытаемся сравнить площадь\r\nядра двух 55-нм продуктов AMD&nbsp;разных поколений: RV670 и&nbsp;RV770.\r\nНеобходимая величина для&nbsp;RV670 хорошо известна&nbsp;&mdash; 192&nbsp;мм2. Если&nbsp;верить\r\nданным китайского сайта Chiphell.com, площадь RV770 составляет 250&nbsp;мм2.\r\nБольшая разница в&nbsp;пользу будущего продукта, превышающая 30%, указывает\r\nна&nbsp;кардинальную модернизацию его&nbsp;архитектуры.\r\n<!-- pagebreak --></p>\r\n<p style="text-align: justify;">По&nbsp;версии VR-Zone, очевидное усложнение ядра RV770 связано, прежде\r\nвсего, с&nbsp;увеличением количества шейдерных процессоров. Со&nbsp;ссылкой\r\nна&nbsp;информацию от&nbsp;участников форума Chiphell.com сообщается, что&nbsp;новый\r\nчип&nbsp;AMD&nbsp;содержит 800&nbsp;универсальных процессоров. По&nbsp;другим данным,\r\nпредоставленным китайским сайтом Expreview.com, в&nbsp;RV770 будет\r\n480&nbsp;процессоров. Последнее предположение выглядит более правдоподобным.\r\nОб&nbsp;усилении текстурной производительности и&nbsp;количестве блоков\r\nрастеризации\r\nпока ничего не&nbsp;известно. Так&nbsp;или иначе, сегодняшние сведения\r\nо&nbsp;численности шейдерных процессоров помогли разобраться, каким образом\r\nинженеры AMD&nbsp;собираются поднять быстродействие нового графического чипа\r\nна&nbsp;40% без&nbsp;значительного прироста рабочей частоты.</p>', '', '', 0, 0, 0, 0, 0, '192.168.0.7', '45', 1, '', '', '', -1, 173, 19, 3, '', 0);
