(47, 5, 0, 0, '2008-02-14 18:29:00', '2008-02-14 18:29:00', '0000-00-00 00:00:00', 'УЕФА объявляет Canon официальным спонсором УЕФА ЕВРО 2008™', '<p>Компания Canon Europe сегодня была объявлена официальным спонсором\r\nчемпионата Европы по&nbsp;футболу&nbsp;&#151; УЕФА ЕВРО 2008<sup>TM</sup>, который состоится в&nbsp;Австрии и&nbsp;Швейцарии в&nbsp;июне 2008 года.</p>', 1, '<p>Компания Canon Europe сегодня была объявлена официальным спонсором\r\nчемпионата Европы по&nbsp;футболу&nbsp;&#151; УЕФА ЕВРО 2008<sup>TM</sup>, который состоится в&nbsp;Австрии и&nbsp;Швейцарии в&nbsp;июне 2008 года.\r\nНовое соглашение продолжает почти тридцатилетнюю историю поддержки\r\nфутбольных мероприятий компанией Canon. Canon в&nbsp;течение нескольких\r\nсезонов являлась официальным поставщиком Лиги Чемпионов УЕФА<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">(1995</span>-2000\r\nи&nbsp;2004-2006), а&nbsp;также спонсировала Чемпионат Европы по&nbsp;футболу УЕФА<sup>TM</sup><span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">(1980</span>-1996), Чемпионат УЕФА ЕВРО 2004<sup>TM</sup><span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">(в</span> качестве официального\r\nспонсора) и&nbsp;турниры Кубка мира<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">(1978</span>-1998).<br /><br /> На&nbsp;счету Canon Europe спонсорская поддержка финальных матчей Кубка\r\nУЕФА<sup>TM</sup><span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">(с</span> финала 2006/07 и&nbsp;до&nbsp;финала 2008/09), а&nbsp;также матчей Суперкубка\r\nУЕФА<sup>TM</sup><span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">(c</span> 2007 года, включая матч августа 2008 года). Компания Canon\r\nEurope является официальным спонсором Российской футбольной\r\nпремьер-лиги и&nbsp;Кубка африканских наций 2008 года в&nbsp;Гане.<br /><br /> Дэвид Тейлор<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">(David</span> Taylor), генеральный секретарь УЕФА,\r\nпрокомментировал событие:<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">&laquo;Компания</span> Canon активно поддерживает\r\nфутбольные мероприятия не&nbsp;одно десятилетие. Особенно продуктивным\r\nявляется спонсорство Чемпионата Европы по&nbsp;футболу УЕФА<sup>TM</sup>. Большой честью\r\nдля&nbsp;нас&nbsp;стала совместная подготовка к&nbsp;ЕВРО 2008<sup>TM</sup> в&nbsp;Австрии и&nbsp;Швейцарии,\r\nмы&nbsp;надеемся на&nbsp;дальнейшее сотрудничество&raquo;.<br /><br /> Хадзиме Цуруока<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">(Hajime</span> Tsuruoka), исполнительный директор и&nbsp;президент компании Canon Europe, заявил:<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">&laquo;Футбол</span>&nbsp;&#151; зрелищный вид&nbsp;спорта, вдохновляющий миллионы людей. Мы&nbsp;рады продолжить спонсорскую\r\nподдержку футбола, укрепляя партнерские отношения с&nbsp;УЕФА&raquo;.<br /><span style="margin-right: 0.3em"> </span> <br /><span style="margin-left: -0.3em">&laquo;Чемпионат</span> УЕФА ЕВРО 2008<sup>TM</sup> даёт нам&nbsp;замечательную возможность\r\nпреодолеть национальные и&nbsp;культурные границы и&nbsp;продвинуть продукцию\r\nCanon с&nbsp;помощью самого популярного спорта в&nbsp;мире Поддержка компанией\r\nCanon такого увлекательного чемпионата подтверждает наш&nbsp;вклад в&nbsp;развитие футбола и&nbsp;преданность футбольным болельщикам всего мира,\r\nкоторые будут следить за&nbsp;игрой&raquo;.<!-- pagebreak --><br />Ещё одно важное преимущество сотрудничества с&nbsp;УЕФА&nbsp;&#151; широкое\r\nосвещение компании Canon на&nbsp;телевидении благодаря рекламе во&nbsp;время\r\nматчей Также в&nbsp;рамках поддержки организации чемпионата Canon представит\r\nновейшие бизнес-решения в&nbsp;нескольких центрах для&nbsp;СМИ. Специально для&nbsp;профессиональных фотографов, которые будут присутствовать на&nbsp;чемпионате, Canon разместит внутри стадиона центры для&nbsp;СМИ, в&nbsp;которых\r\nможно будет провести техническое обслуживание камеры и&nbsp;объектива, а&nbsp;также взять продукцию компании напрокат.<br /><br />Canon примет участие в&nbsp;организации официальных площадок для&nbsp;болельщиков в&nbsp;8&nbsp;городах, в&nbsp;которых\r\nбудут проходить матчи, а&nbsp;также в&nbsp;бизнес-туре<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">&laquo;Мероприятия</span> УЕФА в&nbsp;Европе&raquo;<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">(UEFA</span> Euro Experience), создаваемом для&nbsp;демонстрации в&nbsp;Австрии\r\nи&nbsp;Швейцарии во&nbsp;время чемпионата.</p>', '', '', 0, 0, 0, 0, 0, '192.168.0.1', '47', 1, '', '', '', -1, 2, 19, 0, '', 0),
