(130, 0, 0, 0, 172, 1, 2, 0, 0, 0, 'Ford C-MAX Giha. Пробег 19 000 км', '', '', '', '<p>Дополнительная информация:  <br />Автомобиль покупался у официального дилера в автосалоне. Состояние отличное, пробег 19 000 км</p>\r\n<p><strong>Базовая комплектация: Ford C-MAX Giha</strong></p>\r\n<ul>\r\n<li>Иммобилайзер</li>\r\n<li>ABS</li>\r\n<li>Центральный замок с ДУ</li>\r\n<li>Кожаный руль</li>\r\n<li>Бортовой компьютер</li>\r\n<li>Электропривод передних стеклоподъемников</li>\r\n<li>Солнцезащитные козырьки водителя и пассажира с закрывающимися зеркалами, подсветка багажного отделения</li>\r\n<li>Подлокотник для водителя</li>\r\n<li>Радио пакет №2 : 6 динамиков высокого класса CD+AM/FM радио высокого класса</li>\r\n<li>Наружные зеркала заднего вида с электроприводом регулировки и корпусами, окрашенными в цвет кузова</li>\r\n<li>Кондиционер с ручным управлением </li>\r\n<li>Плафоны для чтения, установленные над задним сидением</li>\r\n<li>Передние лампы для чтения карт</li>\r\n<li>Система установки сидений Comfort Seat</li>\r\n<li>Держатель для солнцезащитных очков</li>\r\n<li>Откидные столики, встроенные в спинки сидений</li>\r\n<li>Стереофонический радиоприемник/CD-проигрыватель(6000CD)</li>\r\n</ul>', 'shop_items_catalog_image130.jpg', 'small_shop_items_catalog_image130.jpg', 0.00, 540000.00, 1, -1, 0, 'ford-c-max-giha-mileage-19-000-km', 'Автомобиль покупался у официального дилера в автосалоне. Состояние отличное, пробег 19 000 км', 'Автомобиль покупался у официального дилера в автосалоне. Состояние отличное, пробег 19 000 км', 'Автомобиль покупался у официального дилера в автосалоне. Состояние отличное, пробег 19 000 км', 1, 59, 100, 236, 400, 0, 0, 0, 0, '', '', 19, 0, '2008-04-22 15:02:13', 0, '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0.00, 0.00, 0.00, 1, 1, 1, 0, 0, 0),
