(150, 0, 0, 0, 66, 1, 2, 0, 0, 0, 'Кроватка детская', '', '', '', '<p>Продам кроватку маятник + кокосовый матрас зима-лето. Натуральное дерево,удобные ящики для&nbsp;вещей, регулируемая высота. Идеальное состояние, прилагается комплект бежевого цвета &laquo;мамина радость&raquo;</p>', 'shop_items_catalog_image150.jpg', 'small_shop_items_catalog_image150.jpg', 0.00, 3600.00, 1, -1, 0, 'baby-cot', 'Кроватка детская', 'Кроватка детская', 'Кроватка детская', 1, 74, 100, 243, 325, 0, 0, 0, 0, '', '', 19, 0, '2008-04-24 16:51:36', 0, '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0.00, 0.00, 0.00, 1, 1, 1, 0, 0, 0),
(152, 0, 0, 0, 66, 1, 2, 0, 0, 0, 'Вещи на девочку 1-2 года', '', '', '', 'Продам фирменные детские вещи в&nbsp;хорошем состоянии. Пальто, куртки, сапожки<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">(новые</span>) на&nbsp;возраст 1-2 года, все&nbsp;за&nbsp;1000р.', 'shop_items_catalog_image152.jpg', 'small_shop_items_catalog_image152.jpg', 0.00, 1000.00, 1, -1, 0, 'things-at-the-girl-1-2-years', 'Вещи на девочку 1-2 года', 'Вещи на девочку 1-2 года', 'Вещи на девочку 1-2 года', 1, 74, 100, 243, 325, 0, 0, 0, 0, '', '', 19, 0, '2008-04-24 17:00:19', 0, '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0.00, 0.00, 0.00, 1, 1, 1, 0, 0, 0),
(153, 0, 0, 0, 145, 1, 2, 0, 0, 0, 'Изготовление мебели на заказ, выезд замерщика, составление дизайн-проекта.', '', '', '', '<p>Наша фирма занимается изготовлением мебели на&nbsp;заказ, такой, как&nbsp;прихожие, шкафы-купе, гардеробные, как&nbsp;встроенного, так&nbsp;и&nbsp;корпусного варианта, с&nbsp;выездом замерщика и&nbsp;составлением дизайн-проекта с&nbsp;учетом пожеланий заказчика и&nbsp;нашими советами.</p>', 'shop_items_catalog_image153.jpg', 'small_shop_items_catalog_image153.jpg', 0.00, 0.00, 1, -1, 0, 'manufacture-of-furniture-to-order-exit-zamershchika-drawing-up-of-the-design-project', 'Изготовление мебели на заказ, выезд замерщика, составление дизайн-проекта.', 'Изготовление мебели на заказ, выезд замерщика, составление дизайн-проекта.', 'Изготовление мебели на заказ, выезд замерщика, составление дизайн-проекта.', 1, 74, 97, 243, 319, 0, 0, 0, 0, '', '', 19, 0, '2008-04-24 17:13:42', 0, '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0.00, 0.00, 0.00, 1, 1, 1, 0, 0, 0),
(146, 0, 0, 0, 221, 1, 2, 0, 0, 0, 'Водитель снабженец', '', '', '', 'Женщина стаж вождения 11&nbsp;лет, л/авто, москвичка 41&nbsp;год, высшее образование, секретариат, закупка зап.частей, компьютер, и&nbsp;т.д.', '', '', 0.00, 0.00, 1, -1, 0, 'the-driver-of-the-supplier', 'Водитель снабженец', 'Водитель снабженец', 'Водитель снабженец', 1, 0, 0, 0, 0, 0, 0, 0, 0, '', '', 19, 0, '2008-04-24 16:24:38', 0, '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0.00, 0.00, 0.00, 1, 1, 1, 0, 0, 0),
(147, 0, 0, 0, 221, 1, 2, 0, 0, 0, 'Менеджер по продажам', '', '', '', 'Ведение и&nbsp;расширение клиентской базы<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">(активные</span> продажи). Заключение договоров, составление заявок. Прямая работа со&nbsp;складом, бухгалтерией. Д\\ К&nbsp;задолжность. Первичная бухгалтерия<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">(41</span>,60,62,50,51 и&nbsp;др.),складской учет. Внутренние отчеты. Длительные региональные командировки. Возможна смена города.\r\nПК&nbsp;бухгалтерские складские офисные программы Интернет\r\nРабота только с&nbsp;живым товаром.\r\nЗ-та Оклад + %\r\nПроживание м. Отрадное.\r\nЖелательно работа на&nbsp;дому.', '', '', 0.00, 0.00, 1, -1, 0, 'sales-manager', 'Менеджер по продажам', 'Менеджер по продажам', 'Менеджер по продажам', 1, 0, 0, 0, 0, 0, 0, 0, 0, '', '', 19, 0, '2008-04-24 16:26:56', 0, '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0.00, 0.00, 0.00, 1, 1, 1, 0, 0, 0),
(148, 0, 0, 0, 113, 1, 2, 0, 0, 0, 'Производство кожгалантерейных изделий. Готовый бизнес. Срок существования 12 лет.', '', '', '', 'Производство кожгалантерейных изделий. Готовый бизнес. Срок существования 12&nbsp;лет. Большая станочно-техническая база. 8&nbsp;человек. Аренда 170&nbsp;м2. Перспектива развития. Прибыль 10&nbsp;тыс. $', '', '', 0.00, 3500000.00, 1, -1, 0, 'production-of-leather-goods-ready-business-term-of-12-years', 'Производство кожгалантерейных изделий. Готовый бизнес. Срок существования 12 лет.', 'Производство кожгалантерейных изделий. Готовый бизнес. Срок существования 12 лет.', 'Производство кожгалантерейных изделий. Готовый бизнес. Срок существования 12 лет.', 1, 0, 0, 0, 0, 0, 0, 0, 0, '', '', 19, 0, '2008-04-24 16:38:10', 0, '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0.00, 0.00, 0.00, 1, 1, 1, 0, 0, 0),
(149, 0, 0, 0, 54, 1, 2, 0, 0, 0, 'Продаю пианино "Petrof" отличное внешнее и тех. состояние. 2 педали. Орех(шоколад) полированное.', '', '', '', 'Продаю пианино<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">&laquo;Petrof</span>&raquo; отличное внешнее и&nbsp;тех. состояние. 2&nbsp;педали. Орех<span style="margin-right: 0.3em"> </span> <span style="margin-left: -0.3em">(шоколад</span>) полированное.\r\nНастроено. Мастер смотрел. Дека целая. 1989 г.вып. Глубокий и&nbsp;яркий звук. 1&nbsp;этаж.', 'shop_items_catalog_image149.jpg', 'small_shop_items_catalog_image149.jpg', 0.00, 45000.00, 1, -1, 0, '', 'Продаю пианино "Petrof" отличное внешнее и тех. состояние. 2 педали. Орех(шоколад) полированное.', 'Продаю пианино "Petrof" отличное внешнее и тех. состояние. 2 педали. Орех(шоколад) полированное.', 'Продаю пианино "Petrof" отличное внешнее и тех. состояние. 2 педали. Орех(шоколад) полированное.', 1, 66, 100, 215, 325, 0, 0, 0, 0, '', '', 19, 0, '2008-04-24 16:42:24', 0, '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 0.00, 0.00, 0.00, 1, 1, 1, 0, 0, 0),
