(6, 1, 1, 'ASSIST', 60, 'Оплата кредитной картой через систему ASSIST.', '', 0, 0, 1, 19, 0),
(7, 1, 1, 'Оплата с лицевого счета', 70, 'Оплата с лицевого счета осуществляется при наличии достаточной суммы на лицевом счете пользователя.', '', 0, 0, 1, 19, 0),
(8, 1, 1, 'RBK Money', 80, 'Платежная система, позволяющая принимать платежи на своем сайте более чем двадцатью способами, в том числе <b>из России</b>: Наличными в Москве, Сбербанк РФ (кроме Москвы), Банковский платеж, Наличными по системе Контакт, Терминалы Элекснет, Терминалы и пункты приема ОСМП.\r\n<br/><b>Из Украины</b>: Наличными в Киеве, Приват 24, Наличными в Приватбанке, Банковский перевод.\r\n<br/><b>Электронные способы</b>: E-GOLD, RBK Money (внутренний перевод), Интернет.Деньги, Яндекс.Деньги.', '', 0, 0, 1, 19, 0),
(9, 1, 1, 'ROBOKASSA', 90, 'Платежная система, позволяющая принимать платежи на своем сайте более чем 13 способами:  Webmoney, Яндекс.Деньги, Moneymail RUB, RBK Money RUB, EasyPay, Единый кошелек, LiqPay, WebCreds, SMS-платежи, переводы через систему Contact и через терминалы мгновенной оплаты QIWI.', '', 0, 0, 1, 19, 0),
(10, 3, 1, 'PayPal', 100, 'Оплата через платежную систему PayPal.', '', 0, 0, 1, 19, 0),
(12, 1, 1, 'Оплата через SMS сервиса AvisoSMS', 110, 'Оплата заказа с использованием SMS.', '', 0, 0, 1, 19, 0),
(13, 1, 1, 'IntellectMoney', 130, 'Оплата картами VISA и MasterCard, в терминалах самообслуживания, через систему денежных переводов CONTACT, банковским переводом, со счета в системе IntellectMoney.', '', 0, 0, 1, 19, 0),
(14, 1, 1, 'Platron', 140, 'Электронная платежная система Platron позволяет оплатить банковскими картами, через платежные терминалы и салоны связи, электронные деньги (Яндекс.Деньги, Webmoney, Monemail, Мобильный кошелек, RBK Money), оплатой с баланса мобильного телефона БиЛайн.\r\n', '', 0, 0, 1, 19, 0),
(15, 1, 1, 'A1Pay', 150, 'Система принимает оплату через SMS, терминалы, WebMoney, Яндекс.Деньги, RBK-Money, W1 или Личный кабинет Qiwi.', '', 0, 0, 1, 19, 0),
(16, 1, 1, 'QIWI Кошелек', 160, 'Оплата наличными в терминалах QIWI, оплата на сайте QIWI Кошелька или с помощью приложений для социальных сетей и мобильных телефонов.', '', 0, 0, 1, 19, 0),
(17, 1, 1, 'Яндекс.Деньги', 50, 'Оплата через платежную систему Yandex.Деньги.', '', 0, 0, 1, 19, 0),
(18, 1, 1, 'Onpay', 170, 'Оплата через платежный агрегатор Onpay.', '', 0, 0, 1, 19, 0),
(19, 3, 1, 'Interkassa', 180, 'Сервис решает задачи по организации процесса приема платежей с помощью подключения всех (из возможного множества) платежных систем (Webmoney, RBKMoney, MoneyMail, WebCreds, НСМЭП, Приват24 и другие).', '', 0, 0, 1, 19, 0),
(20, 0, 1, 'LiqPay', 190, 'Оплата картами Visa/MasterCard и со счетов LiqPAY.', '', 0, 0, 1, 19, 0),
(21, 0, 1, 'Way to Pay', 200, 'Оплата электронными деньгами, SMS, картами VISA.', '', 0, 0, 1, 19, 0),
(22, 0, 1, 'Почтовый перевод', 210, '', '', 0, 0, 1, 19, 0),
(23, 1, 1, 'PayAnyWay', 220, 'Банковские карты VISA и MasterCard, электронные платежные системы Яндекс.Деньги, Webmoney, Монета.Ру, Единый кошелек, Деньги@Mail.Ru, салоны связи Евросеть, Связной, SMS-оплата (МТС, Билайн, Мегафон), платежные терминалы (Элекснет, Новоплат и т.д.), системы онлайн-банкинга, системы денежных переводов (Contact, Почта России).', '', 0, 0, 1, 19, 0),
(24, 0, 1, 'Acquiropay', 230, '', '', 0, 0, 1, 19, 0),
(25, 0, 1, 'Cash24', 240, 'Cash24 - это интернет-касса, которая дает возможность интернет-магазину принимать оплату за товары или услуги всеми современными видами электронных платежей: электронные деньги, банковские карты, денежные переводы, оплата в терминалах самообслуживания, оплата со счета мобильного и другие способы, а также вести учет операций и управлять транзакциями в личном кабинете', '', 0, 0, 1, 19, 0);
